    assertNumbers(args);
    const parsedArgs = args
      .slice(0, 3)
      .map((val) => `${expressionToGlsl(context, val)} / 255.0`);
    if (args.length === 3) {
      return `vec4(${parsedArgs.join(', ')}, 1.0)`;
